function getRandomIntInclusive(min, max) {
  min = Math.ceil(min);
  max = Math.floor(max);
  return Math.floor(Math.random() * (max - min + 1)) + min; //The maximum is inclusive and the minimum is inclusive 
}

function getRandomIntInclusiveNotRepeating() {
    
    var thisRandom = getRandomIntInclusive(0, 9); 
    if (thisRandom != bootstrapNow) {
        bootstrapNow = thisRandom; 
        return thisRandom;
    }
    else if (bootstrapNow == 9) {
        thisRandom = getRandomIntInclusive(0, 8);
        bootstrapNow = thisRandom; 
        return thisRandom;
    }
    else {
        bootstrapNow = bootstrapNow + 1; 
        return bootstrapNow;
    }
}

// Standard Normal variate using Box-Muller transform.
function randn_bm() {
    var u = 0, v = 0;
    while(u === 0) u = Math.random(); //Converting [0,1) to (0,1)
    while(v === 0) v = Math.random();
    return Math.sqrt( -2.0 * Math.log( u ) ) * Math.cos( 2.0 * Math.PI * v );
}


